  query GetFeatured {
    projects {
      title
      description
      image
      githubUrl
      liveUrl
      badges
    }
  }
`;

export default function Featured() {
  return (
    <section className="featured">
      <h2>&#128187; - Featured Projects</h2>
      <Project />
    </section>
  );
}
